import style from "./Card.module.css"

const Card = ({id, name, status, species, gender, origin, image, onClose}) => {
   return (
      <div className={style.contenedor}>
         <img src={image} alt='' />
         <h2>Name:{name}</h2>
         <h2>Status: {status}</h2>
         <h2>Especie: {species}</h2>
         <h2>Genero: {gender}</h2>
         <h2>Origen: {origin}</h2>
         <button onclick={onClose}>Cerrar</button>
      
      </div>
   );
}

export default Card
